import React from "react";


function Dogs({dogs}){

    {console.log(`this is: ${dogs}`)};
    return(
        <>
        <h1>All Dogs Here!</h1>
        {dogs.map(d => (
            <li>{d.name}</li>
        ))}
        </>
    )
}

export default Dogs;
